      body {
  margin: auto;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale; }

  .wysiwyg-content main > :first-child {
    padding-top: 0 !important;
    margin-top: 0 !important; }
  .wysiwyg-content main > :last-child {
    padding-bottom: 0 !important;

  .wysiwyg-content img {

      /* From GitHub markdown view style */
body {
  max-width: 980px;
  font-family: 'Roboto', sans-serif;
  color: #d3ddd3;
  background-color: #454545 }
  main {
    padding: 45px; }

  .wysiwyg-content h1,
  .wysiwyg-content h2,
  .wysiwyg-content h3,
  .wysiwyg-content h4,
  .wysiwyg-content h5,
  .wysiwyg-content h6,
  .wysiwyg-content p,
  .wysiwyg-content blockquote,
  .wysiwyg-content ul,
  .wysiwyg-content ol,
  .wysiwyg-content iframe {
    margin: 16px 0; }


  .wysiwyg-content h1,
  .wysiwyg-content h2,
  .wysiwyg-content h3,
  .wysiwyg-content h4,
  .wysiwyg-content h5,
  .wysiwyg-content h6 {
    color: #d3ddd3;
    font-weight: bold;
    line-height: normal; }
    .wysiwyg-content h1 {
      font-size: 30px;
      border-bottom: 1px solid white;
      width: 60%;
      padding-bottom: 10px;
    }
    .wysiwyg-content h2 {
      font-size: 26px; }
    .wysiwyg-content h3 {
      font-size: 22px; }
    .wysiwyg-content h4 {
      font-size: 20px; }
    .wysiwyg-content h5 {
      font-size: 18px; }
    .wysiwyg-content h6 {
      font-size: 16px; }

  .wysiwyg-content p,
  .wysiwyg-content li {
    font-size: 15px;
    line-height: 2; }

  /* For the most part from material.min.css */
  .wysiwyg-content blockquote {
    position: relative;
    font-size: 18px;
    font-weight: 300;
    font-style: italic;
    line-height: 1.35;
    letter-spacing: .08em;
    margin-left: 30px;
    padding-left: 10px; }
    blockquote:before {
      border-left: 5px solid #d3ddd3;
      padding-left: 5px;
      position: absolute;
      left: -0.5em;
      content: '“'; }
    blockquote:after {
      content: '”';
      margin-left: -0.05em; }

  .wysiwyg-content ul,
  .wysiwyg-content ol {
    padding-left: 50px; }

  .wysiwyg-content a {
    color: #32b8c8; }
